import wells from "../APIs/wells"
import { CREATE_NEW_WELL } from "./types"

export default (wellInfo) => {
  return async dispatch => {
    const newWell = {}
    const wellId = wellInfo.well
    const wellInfoCopy = {...wellInfo}
    newWell.wellId = wellInfoCopy
    console.log(newWell)
    const wellData = {wellId: wellInfoCopy}

    const response = await wells.post('/wells', newWell)
    dispatch({type: CREATE_NEW_WELL, payload: wellData })
  }
}
